import { Box, TextField, Typography } from "@mui/material";
import React from "react";
import AppBarTop from "../../components/AppBarTop";
import { PADDING } from "../../constants/Padding";
import { THEME } from "../../constants/Theme";


function LocationList() {
  const [searchLoc, setSearchLoc] = React.useState("");
  const [chooseMap, setChooseMap] = React.useState(false);

  return (
    <Box
      sx={{
        width: "100%",
        display: "flex",
        flexDirection: "column",
        justifyContent: "flex-start",
        alignItems: "center",
      }}
    >
      <AppBarTop text={"Daftar Alamat"} line extButtonTxt={"+ Tambah Alamat"}/>
      {/* 1 */}
      <Box sx={{border: "1px solid #F5F5F5", borderRadius: '8px', width: PADDING, height: '173px', overflow: 'hidden', marginTop: '21px',  display: 'flex'}}>
        <Box sx={{height: '100%', width: '12px', background: THEME.GREEN_PRIMARY,}}/>
        <Box sx={{padding: '15px 17px 15px 17px', }}>
          <Box sx={{background: THEME.GREEN_PRIMARY, width: '53px', height: '19px',  borderRadius: '4px', fontWeight: 600, color: 'white', fontSize: '10px', display: 'flex', justifyContent: 'center', alignItems: 'center'}}>UTAMA</Box>
          <Typography sx={{marginTop: '11px', fontWeight: 500, fontSize: '14px'}}>Adinda</Typography>
          <Typography sx={{marginTop: '6px', fontSize: '12px', fontWeight: 400, color: "#333333"}}>+6281903810</Typography>
          <Typography sx={{marginTop: '5px', fontWeight: 400, fontSize: '12px', color: '#333333'}}>
          Arandra Residence, Jl. Cempaka Putih Raya No.1, RT.1/RW.6, Cemp. Putih Tim., Kec. Cemp. Putih, Kota Jakarta Pusat, Daerah Khusus Ibukota Jakarta 10510
          </Typography>
        </Box>
      </Box>
      <Box sx={{border: "1px solid #F5F5F5", borderRadius: '8px', width: PADDING, height: '173px', overflow: 'hidden', marginTop: '21px',  display: 'flex'}}>
        <Box sx={{height: '100%', width: '12px', background: THEME.GREEN_PRIMARY,}}/>
        <Box sx={{padding: '15px 17px 15px 17px', }}>
          <Box sx={{background: THEME.GREEN_PRIMARY, width: '155px', height: '19px',  borderRadius: '4px', fontWeight: 600, color: 'white', fontSize: '10px', display: 'flex', justifyContent: 'center', alignItems: 'center'}}>Jadikan Alamat Utama</Box>
          <Typography sx={{marginTop: '11px', fontWeight: 500, fontSize: '14px'}}>Adinda</Typography>
          <Typography sx={{marginTop: '6px', fontSize: '12px', fontWeight: 400, color: "#333333"}}>+6281903810</Typography>
          <Typography sx={{marginTop: '5px', fontWeight: 400, fontSize: '12px', color: '#333333'}}>
          Arandra Residence, Jl. Cempaka Putih Raya No.1, RT.1/RW.6, Cemp. Putih Tim., Kec. Cemp. Putih, Kota Jakarta Pusat, Daerah Khusus Ibukota Jakarta 10510
          </Typography>
        </Box>
      </Box>

    </Box>
  );
}

export default LocationList;
